export default class fretSlot {
  constructor(note, string, fret, color, text, isCircle, border) {
    this.note = note;
    this.string = string;
    this.fret = fret;
    this.color = color;
    this.text = text;
    this.isCircle = isCircle;
    this.border = border;
  }
}
